message:
Students &amp; young people are leading the movement on climate change, but many times their cries for change fall on deaf ears. 
@SenatorTomUdall &amp; I hear them &amp; we’re working to protect our lands &amp; waters.

https://t.co/9TqV5KS3nq

All visitors to public lands deserve to feel welcome &amp; comfortable while enjoying all that nature has to offer them. 
@RepAlGreen &amp; I have a bill to change the offensive names of public lands, with input from groups who have been discriminated against.
https://t.co/L1AsLG8JPb

As a single mom who was the sole breadwinner for my family, I know how the gender #paygap impacts access to health care, education, job training &amp; child care.

@senatemajldr is holding up a vote on the Pay Check Fairness Act and must put it to a vote.
#NativeWomensEqualPayDay https://t.co/RyBC1aw2mU

